	/* http://www.zodiackillersite.com/viewtopic.php?p=43016#p43016 
	 * 
	 * his results for 340/408:  http://www.zodiackillersite.com/viewtopic.php?p=42947#p42947
		5-gram comparison for the 408 and 340 in a 17 by 20 grid (do transposition, undo transposition):
		
		408:
		
		Horizontals average: 854, 854
		Verticals average: 453, 317
		Diagonals 1 average: 376, 409
		Diagonals 2 average: 395, 366
		
		340:
		
		Horizontals average: 537, 537
		Verticals average: 387, 546
		Diagonals 1 average: 423, 496
		Diagonals 2 average: 411, 427
		Bigram 19 scheme: 630
		Bigram 15 scheme: 664
	
		The new measurement is in favor of the scheme, and also when comparing other n-gram sizes.	 * 
	 **/
	public static int jarlveFragmentScore(int n, String cipher) {
		int sum = 0;
		for (int i = 1; i < cipher.length() - n + 1; i++) {
			// String sub1 = cipher.substring(i,i+n);
			for (int j = i + 1; j < cipher.length() - n + 1; j++) {
				int c = 0;
				String sub1 = "";
				String sub2 = "";
				for (int k = 0; k < n; k++) {
					char c1 = cipher.charAt(i+k);
					char c2 = cipher.charAt(j+k);
					sub1 += c1;
					sub2 += c2;
					if (c1==c2)
						c++;
				}
				sum += c*(c-1);
					//System.out.println(sub1 + " " + sub2 + " " + i + " " + j);
			}
		}
		return sum;
	}
	/** testing the "modulo 5 / 10" observation: http://www.zodiackillersite.com/viewtopic.php?p=43747#p43747 */
	public static void testModulo() {
		for (int i=0; i<10000; i++) {
			List<Integer> list = new ArrayList<Integer>();
			while (true) {
				if (list.size() == 24) break;
				int pos = (int) (Math.random()*340+1);
				if (list.contains(pos)) continue;
				list.add(pos);
			}
			int count = 0;
			for (Integer k : list) {
				if (k%5 == 0 || k%10 == 0) count++;
			}
			System.out.println(count + ": " + list);
		}
	
	}
	/** the "non-repeat" score, a quick estimate of regularity of cycles */
	public static int nonrepeat(String ciphertext) {
		int sum = 0;
		for (int i=0; i<ciphertext.length(); i++) {
			Set<Character> seen = new HashSet<Character>(); 
			int j=i;
			while (j<ciphertext.length()) {
				char ch = ciphertext.charAt(j);
				if (seen.contains(ch)) break;
				seen.add(ch);
				sum++;
				j++;
			}
		}
		return sum;
	}
	
	/** average length of nonrepeating sequences */
	public static double nonrepeatAverage(String ciphertext) {
		double mean = 0;
		int sum = 0;
		int count = 0;
		for (int i=0; i<ciphertext.length(); i++) {
			Set<Character> seen = new HashSet<Character>(); 
			int j=i;
			while (j<ciphertext.length()) {
				char ch = ciphertext.charAt(j);
				if (seen.contains(ch)) break;
				seen.add(ch);
				sum++;
				j++;
			}
			count++;
		}
		mean = sum;
		mean = mean / count;
		return mean;
	}
	
	
	/** compute non-repeat "single" score (i.e., start at the beginning, and stop once a repeat is found, without continuing further into the string.
	 * This is usually for substrings of a ciphertext. */
	public static int nonrepeatSingle(String ciphertext) {
		int sum = 0;
		Set<Character> seen = new HashSet<Character>(); 
		for (int i=0; i<ciphertext.length(); i++) {
			char ch = ciphertext.charAt(i);
			if (seen.contains(ch)) break;
			seen.add(ch);
			sum++;
		}
		return sum;
	}
	
	/** the "non-repeat" score, a quick estimate of regularity of cycles (normalized by cipher length) */
	public static float nonrepeatNormalized(String ciphertext) {
		float sum = 0;
		for (int i=0; i<ciphertext.length(); i++) {
			Set<Character> seen = new HashSet<Character>(); 
			int j=i;
			while (j<ciphertext.length()) {
				char ch = ciphertext.charAt(j);
				if (seen.contains(ch)) break;
				seen.add(ch);
				sum++;
				j++;
			}
		}
		return sum/ciphertext.length();
	}
	/** Jarlve's alternate non-repeat score.  http://www.zodiackillersite.com/viewtopic.php?p=42120#p42120 */
	public static float nonrepeatAlternate(String ciphertext) {
		Map<Character, Integer> sums = new HashMap<Character, Integer>();
		Map<Character, Integer> counts = new HashMap<Character, Integer>();
		
		for (int i=0; i<ciphertext.length(); i++) {
			char c = ciphertext.charAt(i);
			if (c == ' ') continue;
			Integer sum = sums.get(c);
			if (sum == null) sum = 0;
			sum += i;
			sums.put(c, sum);
			Integer count = counts.get(c);
			if (count == null) count = 0;
			count++;
			counts.put(c, count);
		}
		
		float score = 0;
		for (Character c : sums.keySet()) {
			int sum = sums.get(c);
			int count = counts.get(c);
			float A = ((float)sum)/count;
			score += Math.abs(A - ciphertext.length()/2);
		}
		return score*340/ciphertext.length();
	}
	
	/** http://www.zodiackillersite.com/viewtopic.php?p=47490#p47490 */
	public static float nonrepeatNormalizedAlternate(String ciphertext) {
		Map<Character, Integer> counts = Ciphers.countMap(ciphertext);
		float c = ciphertext.length();
		float s = counts.size();
		float max = (c-(s-1)) * s + (s-1)*s/2;
		
		float nr1 = nonrepeat(ciphertext);
		//float nr2 = nonrepeatNormalized(ciphertext);
		//float nr3 = nonrepeatAlternate(ciphertext);
		
		//System.out.println(nr1/max);
		//System.out.println(nr2/max);
		//System.out.println(nr3/max);
		
		return nr1/max;
	}
	
	/** sum the non-repeat measurement over all substrings of length L along the entire cipher text. */
	public static double nonrepeatWindow(String cipher, int L) {
		double total = 0;
		int count = 0;
		for (int i=0; i<cipher.length()-L+1; i+=L) {
			String sub = cipher.substring(i,i+L);
			
			int non = nonrepeatSingle(cipher.substring(i,i+L));
			
			//System.out.println(cipher.substring(i,i+L) + " " + non);
			//System.out.println("i " + i + " nonrepeat " + non);
			if (non == L) total++;
			//total += non;
				
			count++;
		}
		return total;
	}

	/** todo: don't really need a map.  can do this with just a Set. */
	public static short[] cipherToShort(String cipher) {
		Map<Character, Short> map = new HashMap<Character, Short>();
		Short val = 0;
		for (int i=0; i<cipher.length(); i++) {
			Character key = cipher.charAt(i);
			if (map.containsKey(key)) continue;
			map.put(key, val++);
		}
		
		short[] result = new short[cipher.length()];
		for (int i=0; i<cipher.length(); i++) {
			result[i] = map.get(cipher.charAt(i));
		}
		
		return result;
	}

