	/** "symbol spread" score: compute the average position for each symbol.  gives an idea of how evenly distributed
	 * symbols are in the cipher.  unbalanced symbols suggest they are not randomly placed.
	 * 
	 * positions are indexed starting at 1
	 */
	public static Map<Character, Float> symbolSpread(String cipher) {
		Map<Character, Float> map = new HashMap<Character, Float>();
		Map<Character, Integer> counts = new HashMap<Character, Integer>();
		for (int i=0; i<cipher.length(); i++) {
			char key = cipher.charAt(i);
			Float val = map.get(key);
			if (val == null) val = 0f;
			val+=(i+1);
			map.put(key,val);
			
			Integer count = counts.get(key);
			if (count == null) count = 0;
			count++;
			counts.put(key, count);
		}
		for (Character key : map.keySet()) {
			map.put(key, map.get(key)/counts.get(key));
		}
		return map;
	}
	public static void testSymbolSpread() {
		System.out.println(symbolSpread(Ciphers.cipher[0].cipher));
	}
	
	/** perform random shuffles, to see which symbols of the given cipher behave much differently than the average */ 
	public static void testSymbolSpreadRandom(String cipher) {
		System.out.println(cipher);

		Map<Character, Float> spreadReference = symbolSpread(cipher);
		Map<Character, Integer> counts = Ciphers.countMap(cipher);
		
		Map<Character, List<Float>> spreads = new HashMap<Character, List<Float>>(); 
		for (int i=0; i<1000000; i++) {
			if (i%10000 == 0) System.out.println(i+"...");
			cipher = CipherTransformations.shuffle(cipher);
			Map<Character, Float> spread = symbolSpread(cipher);
			for (Character key : spread.keySet()) {
				List<Float> val = spreads.get(key);
				if (val == null) val = new ArrayList<Float>();
				val.add(spread.get(key));
				spreads.put(key, val);
			}
		}
		
		for (Character key : spreads.keySet()) {
			DescriptiveStatistics stat = new DescriptiveStatistics();
			for (Float val : spreads.get(key)) {
				stat.addValue(val);
			}
			Double sigma = Math.abs(spreadReference.get(key)-stat.getMean())/stat.getStandardDeviation(); 
			System.out.println(key + "	" + counts.get(key) + "	" + stat.getMin() + "	" +stat.getMax() + "	" +stat.getMean() + "	" +stat.getStandardDeviation() + "	" + spreadReference.get(key) + "	" + sigma); 
		}
		
	}
	
	/** http://www.zodiackillersite.com/viewtopic.php?p=47800#p47800 */
	public static float unigramRepeats(String cipher, int L) {
		
		float total = 0;
		for (int i=0; i<cipher.length(); i+=L) {
			Map<Character, Integer> counts = new HashMap<Character, Integer>();
			for (int j=i; j<Math.min(cipher.length(), i+L); j++) {
				char key = cipher.charAt(j);
				Integer val = counts.get(key);
				if (val == null) val = 0;
				val++;
				counts.put(key,val);
				
			}
			for (Character key : counts.keySet()) {
				total+=counts.get(key)-1;
			}
		}
		return total/cipher.length();
	}
	
