	public static void testJarlveHomShuffle() {
		String cipher = Ciphers.cipher[0].cipher;
		System.out.println(homScore(cipher));
		
		DescriptiveStatistics desc = new DescriptiveStatistics();
		for (int i=0; i<10000; i++) {
			cipher = CipherTransformations.shuffle(cipher);
			desc.addValue(homScore(cipher));
			if (i%1000 == 0) System.out.println(i);
		}
		System.out.println(desc.getMin() + " " + desc.getMax() + " " + desc.getMean() + " " + desc.getStandardDeviation());
	}
	
